import React from "react";
import '../Skill/skill.css';
import skilLogo  from '../Assests/skill.jpg'
function Skill(){
return(
    <>
   <div className="skill">
    <div className="logoSkill">
        <img src={skilLogo} alt="skillLogo" />
    </div>
    <div className="box">
        <div className="child">
            
        </div>
    </div>
   </div>
    </>
)
}

export default Skill;
